import styled from "styled-components"
import { FC, ReactNode } from "react"

type FormWrapperProps = {
    children: ReactNode
    title?: string
    index?: number
    isLast?: boolean
}

export const FormWrapper: FC<FormWrapperProps> = ({ children, title }) => {
    return <FormWrapperContainer>
        <FormTitleWrapper>
            {title}
        </FormTitleWrapper>
        {children}
    </FormWrapperContainer>
}

const FormWrapperContainer = styled.div`
    width: inherit;
    height: inherit;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`

const FormTitleWrapper = styled.div`
    height: 3rem;
    align-items: center;
    font-size: 1.5rem;
    font-weight: 600;
    border-bottom: 2px solid #000;
    margin-bottom: 1rem;
`
